@import url("https://fonts.googleapis.com/css2?family=Poppins:wght@400;500;600&display=swap");

* {
  box-sizing: border-box;
  font-family: "Poppins", sans-serif;
}

.wrapper {
  padding: 0 35px;
  max-width: 1200px;
  display: flex;
  align-items: center;
  justify-content: center;
  padding-top: 40px;
  position: relative;
  z-index: 1;
}

.wrapper i {
  top: 50%;
  height: 46px;
  width: 46px;
  cursor: pointer;
  font-size: 1.2rem;
  text-align: center;
  line-height: 46px;
  border-radius: 50%;
  background: $color-dark-background;
  color: white;
  position: absolute;
  transform: translateY(-50%);
  &:first-child {
    left: -23px;
    display: none;
  }
  &:last-child {
    right: -23px;
  }
}

.wrapper .carousel {
  font-size: 0px;
  cursor: pointer;
  overflow: hidden;
  white-space: nowrap;
  margin: 0;
  padding: 0;
  scroll-behavior: smooth;
}

.carousel.dragging {
  cursor: grab;
  scroll-behavior: auto;
}

.carousel.dragging img {
  pointer-events: none;
}

.carousel img {
  height: 340px;
  object-fit: cover;
  margin-left: 14px;
  width: calc(100% / 3);
  &:first-child {
    margin-left: 0px;
  }
}

@media screen and (max-width: 900px) {
  .carousel img {
    width: calc(100% / 2);
  }
}

@media screen and (max-width: 550px) {
  .carousel img {
    width: 100%;
  }
}
